'',
'            <div class="dev">',
unistr('                <strong>Vin\00EDcius Soares</strong><br/>'),
'                <small>Email: <a href="mailto:vinisoares15@gmail.com">vinisoares15@gmail.com</a></small>',
'                <small>LinkedIn: <a href="https://www.linkedin.com/in/vinicius-sf" target="_blank" rel="noopener">/in/vinicius-sf</a></small>',
