'            <li>Para testes locais, use o <strong>ngrok</strong> e configure a URL: <code>https://&lt;ngrok-url&gt;/api/apex/generatePdfFromApex</code></li>',
'        </ul>',
'',
unistr('        <div class="section-title">Criando a A\00E7\00E3o Din\00E2mica</div>'),
'        <ol>',
unistr('            <li>Crie um bot\00E3o na p\00E1gina (ex: "Gerar PDF")</li>'),
unistr('            <li>Adicione uma A\00E7\00E3o Din\00E2mica: tipo <strong>Print Report</strong></li>'),
'            <li>Em Settings &gt; Report Query, selecione a Report Query desejada</li>',
'        </ol>',
